import React, { Component } from 'react';
import './error.css'
import { Link } from 'react-router-dom';
class Error extends Component {
    render() {
        return (
            <div>
              <div className="where-is-pandafish">
              <img src="https://b-gold-cdn.xitu.io/v3/static/img/bg.1f516b3.png" alt=""/>
              <img src="https://b-gold-cdn.xitu.io/v3/static/img/panfish.9be67f5.png" alt=""/>
              <img src="https://b-gold-cdn.xitu.io/v3/static/img/sea.892cf5d.png" alt=""/>
              <img src="https://b-gold-cdn.xitu.io/v3/static/img/spray.bc638d2.png" alt=""/>
              </div>  
              <Link to="/" exact>返回首页</Link>
            </div>
        );
    }
}

export default Error;
